import React from 'react'
import Div from '../../atoms/atDiv'
import * as Util from '../../../controller/util.js';

const layout = props => {
  console.log('Rodando /moJanela');

  var varEstilo = Util.validaProps(props.estilo, "");

  if (varEstilo == "luz") {
    //Layout Luz verde
    return (
      <Div display="vertical">
        <div className="DivJanelaHead"></div>
        <div className="DivJanelaBody">{props.children}</div>
        <div className="DivJanelaFooter"></div>
        <style jsx>{`
        .DivJanelaHead{
          margin : 0;
          height: 10px;
          width: 100%;
          background-image: url("/static/assetsv5/img/layout_luz/janela_luz_02.png");
        }
        .DivJanelaBody{
          margin : 0;
          width: 100%;
          font-size: 17px;
          font-family: sans-serif;
          background-image: url("/static/assetsv5/img/layout_luz/fundo_janela.png");
          display: block;
          /*border: solid 1px #000000;*/
          padding: 10px;
          box-sizing: border-box;
        }        
        .DivJanelaFooter{
          margin : 0;
          height: 10px;
          width: 100%;
          background-image: url("/static/assetsv5/img/layout_luz/janela_luz_02.png");
        }
        .DivJanela{
          width: 100%;
        }

      `}</style>
      </Div>
    )
    }else {
      //Layout escuro
      return (
        <div className="DivSombra">
          {props.children}
          <style jsx>{`
          .DivSombra{
            width: 100%;
            font-size: 17px;
            font-family: sans-serif;
            background-color: #282c45;
            background-image: linear-gradient(45deg, #16192a, #282c45, #282c45 );
            border-radius: 4px;
            display: block;
            /*border: solid 1px #000000;*/
            padding: 10px;
            box-sizing: border-box;
            -webkit-box-shadow: -9px 9px 20px rgba(1, 1, 1, 0.57);
            -moz-box-shadow: -9px 9px 20px rgba(1, 1, 1, 0.57);
            box-shadow: -9px 9px 20px rgba(1, 1, 1, 0.57);        
          }
        `}</style>
        </div>
      )
    }
}

export default layout
